def second_smallest(S: int, D: int) -> str:
    if S <= 9 or D == 1:
        return str(S)
    if S >= 9 * D:
        return '-1'
    ret = []
    while S:
        if S >= 9:
            ret.append(9)
            S -= 9
        else:
            ret.append(S)
            S = 0
    if len(ret) < D:
        ret[-1] -= 1
        while len(ret) < D:
            ret.append(0)
        ret[-1] += 1
    for i in range(D):
        if ret[i] != 9:
            if i >= 1:
                ret[i] += 1
                ret[i - 1] -= 1
            else:
                ret[i] -= 1
                ret[i + 1] += 1
            break
    return ''.join(map(str, ret[::-1]))

