            ret.append(0)
        ret[-1] += 1
    for i in range(D):
        if ret[i] != 9:
            if i >= 1:
                ret[i] += 1
                ret[i - 1] -= 1
            else:
                ret[i] -= 1
                ret[i + 1] += 1
            break
    return ''.join(map(str, ret[::--1]))
